import React from 'react';
import { Switch, Route } from 'react-router-dom';

import Home from './pages/Home';
import Config from './pages/config';

//eslint-disable-next-line
export default () => 
{
    return (
            <Switch>
                <Route exact path="/">
                    <Home/>
                </Route>

                <Route exact path="/config">
                    <Config/>
                </Route>

                <Route exact path="/sobre">
                    Sobre
                </Route>
            </Switch>
    );
}
